import L from "leaflet";

export const LocationIcon = L.icon({
  iconUrl: require("../assets/images/ubicacion.png"),
  iconRetinaUrl: require("../assets/images/ubicacion.png"),
  iconAnchor: null,
  shadowUrl: null,
  shadowSize: null,
  shadowAnchor: null,
  iconSize: [35, 45],
  className: "leaflet-icon",
});
